// src/components/MapManage/NodeDelete.js

import React from 'react';
import './NodeDelete.css';
import { FaTimes } from 'react-icons/fa'; // X 아이콘 임포트

function NodeDelete({ onDelete, style }) {
  return (
    <div className="node-delete-container" style={style}>
      <button className="delete-button" onClick={onDelete}>
        <FaTimes />
      </button>
    </div>
  );
}

export default NodeDelete;
